import "../css/components/command.css";

const About = () => {
  return (
    <div>
      <p>
        I am a aspiring software developer looking for a job that i dont hate so
        i dont have to work in the restaurant industry anymore please hire me
        thank you
      </p>
    </div>
  );
};

export default About;
